const Persons = ({persons}) => {
    return (
      <table>
        <tbody>
          {persons.map(person => <Person person={person} key={person.name} />)}
        </tbody> 
      </table> 
    )
  }
  
  const Person = ({person}) => <tr>
                                    <td>{person.name}</td>
                                    <td>{person.number}</td>
                                    <td>{person.number}</td>
                               </tr>

export default Persons
